function FormSection() {
    const obj = {
        name: 'john',
        age: 50
    }
   
    return (
        <form onSubmit={collectData}>
            <input value={obj.name} name='name' placeholder="name" className="d-block mb-3 mt-3" />
            <input value={obj.age} name='age' placeholder="age" className="d-block mb-3" />
            <button type="button">Submit</button>
        </form>
    )
}
export default FormSection
